define({"topics" : [{"title":"Time Basis and Time-Based Indexes","shortdesc":"\n               <p class=\"shortdesc\">The time basis is the time used by the Elasticsearch destination to write records to         time-based indexes. When indexes\n                  have no time component, you can ignore the time basis         property.\n               </p>\n            ","href":"datacollector\/UserGuide\/Destinations\/Elasticsearch.html#concept_dd3_vhk_r5","attributes": {"data-id":"concept_dd3_vhk_r5",},"menu": {"hasChildren":false,},"tocID":"concept_dd3_vhk_r5-d46e80054","topics":[]},{"title":"Document IDs","shortdesc":"\n               <p class=\"shortdesc\">When appropriate, you can specify an expression that defines the document ID. When you         do not specify an expression,\n                  Elasticsearch generates IDs for each document.\n               </p>\n            ","href":"datacollector\/UserGuide\/Destinations\/Elasticsearch.html#concept_yr2_1tf_z5","attributes": {"data-id":"concept_yr2_1tf_z5",},"menu": {"hasChildren":false,},"tocID":"concept_yr2_1tf_z5-d46e80079","topics":[]},{"title":"Define the CRUD Operation","href":"datacollector\/UserGuide\/Destinations\/Elasticsearch.html#concept_w2r_ktb_ry","attributes": {"data-id":"concept_w2r_ktb_ry",},"menu": {"hasChildren":false,},"tocID":"concept_w2r_ktb_ry-d46e80114","topics":[]},{"title":"Configuring an Elasticsearch Destination","href":"datacollector\/UserGuide\/Destinations\/Elasticsearch.html#task_uns_gtv_4r","attributes": {"data-id":"task_uns_gtv_4r",},"menu": {"hasChildren":false,},"tocID":"task_uns_gtv_4r-d46e80156","topics":[]}]});